import { CSSTransition, TransitionGroup } from 'react-transition-group';
import style from './Category.module.css';
import Category_container from './Category_container';

function Category({}) {
  const categories = ["2022", "2021", "2020", "2019"];

  return (
    <div className={style.container}>
      <TransitionGroup className={style.container}>
        {categories.map((category, idx) => (
          <CSSTransition
            key={category}
            timeout={500}
            classNames="item"
            appear={true}
          >
            <Category_container>{category}</Category_container>
          </CSSTransition>
        ))}
      </TransitionGroup>
    </div>
  );
}

export default Category;
